Creating a custom event normally happens in JavaScript, because it's part of the browser's runtime. The code looks like this: const event = new Event('build'); // Listen for the event.
elem.addEventListener('build', (e) => { /* … */ }, false); // Dispatch the event.
elem.dispatchEvent(event); https://developer.mozilla.org/en-US/docs/Web/Events/Creating_and_triggering_events We need to do something similar in our Rust code. To do this we'll use the web_sys crate. There is a struct in web_sys called CustomEvent Docs Let's go over some struct basics since we're going to e using them for this lesson and going forward. Introduction to Structs A struct is like a class in a lot of object oriented languages. It is a category of type that has the ability to group data, functionality related to that data, and functionality related to its general idea, all around a single name. Recall that a type is the name that describes a set of possible values. Struct data One of the key features of structs in Rust is that they specify a grouping of data types and values which we call properties. I suspect this is why they're called structs—structured data or data structure. If we had a Bacon Lettuce and Tomato sandwich struct it's definition would look like this: struct BLTSandwich { bread: TypeOfBread, lettuce: TypeOfLettuce, tomato: TypeOfTomato, bacon: TypeOfBacon, mayo: bool
} The above example expects that TypeOfBread, TypeOfLettuce, TypeOfTomato, and TypeOfBacon are all defined earlier. They are used here to illustrate that BLTSandwich has constrained which values it's specific proeprties can have. You can not have a BLTSandwich with rocks as a value for bacon, because rocks are not a type of bacon! This is why type systems are important. They help prevent us from eating rocks... or... making mistakes in our programs. :) If you have keen eyes you'll recognize something here. There's a pattern that we've seen a few times before. // a function definition
fn function_name( parameter: type ) {} // a struct definition
struct StructName{ property: type } This pattern can be abstracted to the following: Rust keyword to define context/subject (fn, struct) A name to be able to use the noun(function_name, StructName) Some form of encapsulation with configuration Make a new thing from an idea (a concretion) A struct or structure is like an idea. And ideas aren't real in a sense that we can't hold them. We have an idea of what a BLT Sandwich is, but we can't eat the idea. But we have written specification for what the BLT is in the definition of our struct. If we were to take the idea of a BLT sandwich and make A BLT sandwich we would say that we were making a concretion. A thing that is concrete or real. In object oriented programming (OOP) we would say that we are instantiating the idea (in oop ideas are classes). We are creating an instance of it. The syntax to create a struct includes writing the stuct's name, followed by curly braces, and a list of the property names and their values. // Assuming that the values for these // properties were already defined in scope
// with statements like
// let canadian_rye = get_the_best_sandwich_bread();
BLTSandwich{ bread: canadian_rye, lettuce: romaine, tomato: black_krim, bacon: farm_smoked_apple_bacon,
} Most library (crate) authors write functions associated with a struct (with the idea of it) to make a concretion. It's convention for this function to be called 'new'. Calling the function follows this syntax: let my_thing = SomeStruct::new(); Functionality associated with the idea (static methods) Structs can have functionality associated with the name of the struct. Some would described as functions that are namespaced, meaning that they are prefixed to or expected to be understood in the context of the name (being the struct's name). The following showcases a new function in the BLTSandwich namespace which returns a new BLTSandwich (a concretion). impl BLTSandwich { pub fn new() -> BLTSandwich { BLTSandwich{ bread: canadian_rye, lettuce: romaine, tomato: black_krim, bacon: farm_smoked_apple_bacon } } pub fn name() -> String { "Bacon, Lettuce and Tomato Sandwich".to_string() }
} Normally there would be parameters in the new function to accept arguments to configure the new thing being created. I skipped on that for the sake of simplicity. We can see here that we also have a name function which returns a long form name of the sandwich as a string. We could call this by writing: let the_sandwich_name : String = BLTSandwich::name(); Again, we can see that these are functions associated with the idea and separated by two colons. But again, look closely! A pattern emerges! We previously used a function called leptos::log!. But leptos isn't a struct, it's a crate! Rust uses the same pattern of double colons to say, "We're setting the context to qualify which thing we're talking about". When we say BLTSandwich::name, we're telling Rust "Ok, think about BLTSandwich things... when I say name, you know what I'm talking about." The Rust language designers have done a superb job at making these things easy to remember if you're aware that there is a pattern and design behind the decision. I can only assume that these design decisions were very deliberate. Functionality associated with the a concretion (methods) We can associate functionality with a specific concretion (a struct made real) which we often call methods. If we had a mthod called calories we could call with the following Rust code: let sandwich = BLTSandwich::new();
let calories = sandwich.calories(); Here we make a sandwich and call calories on it. The context here is so tightly coupled that we use a single dot as a separator. I like to think of it as this. 4 dots — A namespace is a grouping of many things, so we use many dots. 1 dot — A value is a single thing, so we use one dot. The neat thing about the above is that if you didn't need to use sandwich you can chain these all together: let calories = BLTSandwich::new().total_calories(); ^----------------^ This will evaluate into a 'sandwich' which we can call total_calories() on. Methods always have a special &self parameter as the first argument to denote that they're able to make reference to itself. This is how a function has the ability to do anything with it's own data. Recall that we can not use a piece of data unless it is in scope. // Imagine that there is some function called calories, // which accepts things that can be turned into a calories
// value which is a 32 bit integer. Don't worry about how this
// would work. This is just a simple example. impl BLTSandwich { // imagine the other static methods or namespace // function from before were still here. pub fn total_calories(&self) -> i32 { calories(self.bread) + calories(self.lettuce) + calories(self.tomato) + calories(self.bacon) // Recall that this function will evaluate to the // last statement in its body. That's why there's no // semicolon at the end of this last item. } pub fn name() -> String { "Bacon, Lettuce and Tomato Sandwich".to_string() }
} Note that we're able to use the value of the struct's properties with .bread. If we look at the function total_calories it starts to look really similar to .bread. with the exception of us adding parenthesis at the end to call the fucntion. Yet another pattern emerges, methods on a value are properties on the value that you can call! let sandwich = BLTSandwich::new();
sandwich.bread;
sandwich.total_calories; //<- but then we add () to call it Using web_sys::CustomEvent We're well positioned to use the web_sys crate's CustomEvent struct. If we zip over to the documentation we can see that there is a new method on the struct Docs : web_sys::CustomEvent::new("my-custom-event"); But there's a notice under the definition of the new method that states the following: This API requires the following crate features to be activated: CustomEvent I did a quick search for "web_sys enable feature" which lead me to this support doc Enable the cargo features for the APIs you're using . Leptos includes these web_sys features for you as part of its library. If we go back to the new method's definition in the web_sys::CustomEvent docs we'll see the following definition: pub fn new(type_: &str) -> Result<CustomEvent, JsValue> Notice that it returns after the -> a Result type, which has some type arguments (generics). The first one refers to what we get if new is run and the result is Ok, the second is the result that we get if new runs and the result is an Error. We can handle these with some in build pattern matching which we'll go into more later. Our component code now looks like this: #[component] fn MyComponent(cx: Scope) -> Element { let trigger_sending_of_custom_event = |_|{ match web_sys::CustomEvent::new("my-custom-event") { Ok(event) => { // We have an event that we can send }, Err(_) => { // There as an error in creating the event // We're not doing anything with this for now // so we'll use an '_' to destructure it's error // message } } }; view!{ cx, <div> <button on:click=trigger_sending_of_custom_event> "Trigger custom event" </button> </div> } } The match keyword requires that we create branches/arms for each possible option. Recall that we talked about types as restrictions that describe possible values. A result is an enumeration (a list of possible values or strict set of options) which can be one of two values. It can be Ok or Err. The options are called variants. In both of those cases there is a value that we can destructure out of the variants. Their types are listed as the the first and second type arguments in the returned type's signature. Result<CustomEvent, JsValue> means that we'll have an Ok( CustomEvent ) or an Err(JsValue). I know from the JavaScript custom event documentation that it's not enough to create the event. We need to emit it. This is called dispatching. The javascript looks like this. elem.dispatchEvent(event); What we need is some way to refer to our <MyComponent /> so that we can dispatch the event on it. We need a reference to it.

