Leptos provides us with the ability to get a reference to the DOM node created by its view! template. Think of it like a direct line to its DOM counterpoint. The first step is to create the nodeRef, and add it as a special _ref property to the parent/root element in the view! template. Recall that the Leptos component is proxy for the view! template's root element. Putting the reference on this div is the same as putting the reference on <MyComponent />. #[component] fn MyComponent(cx: Scope) -> Element { let dom_node_ref = NodeRef::new(cx); // abbreviated/folded Rust code here for space saving view!{ cx, <div _ref=dom_node_ref> <button on:click=trigger_sending_of_custom_event> "Trigger custom event" </button> </div> }
} The dom_node_ref uses signals under the hood so we can move it into our handler closure without stressing about move semantics. We'll add the move keyword to the closure and we'll add some more matching if we are able to make our custom event. match dom_node_ref.get() { None => { // None will only happen if this component isn't // mounted to the DOM, but it has to be in order // for the click event to fire, so we can ignore this } Some(dom_element) => { // Emit/dispatch our custom event } } We call 'get' on the dom_node_ref to get the actual DOM element in Rust form. There are cases when the DOM element/node might not exist. Rust requires us to account for all possibilities, which is why the get method returns a option type. It's return type definition is Option<web_sys::Element>. Option is an enum which can be None or Some with the type argument provided in it's signature. In this case it's of the web_sys::Element type. We're destructing it and giving it the label dom_element #[component] fn MyComponent(cx: Scope) -> Element { let dom_node_ref = NodeRef::new(cx); let trigger_sending_of_custom_event = move |_|{ match web_sys::CustomEvent::new("my-custom-event") { Ok(event) => { match dom_node_ref.get() { None => { // None will only happen if this component isn't // mounted to the DOM, but it has to be in order // for the click event to fire, so we can ignore this } Some(dom_element) => { // Emit/dispatch our custom event } } }, Err(_) => {} } }; view!{ cx, <div _ref=dom_node_ref> <button on:click=trigger_sending_of_custom_event> "Trigger custom event" </button> </div> } } Intuitively, we'll probably want to try something like this for the actual event sending. This is a focused view of the happy path match arm: match dom_node_ref.get() { None => {} Some(dom_element) => { dom_element.dispatch_event(event); } } Unfortuantely this doesn't work. Rust tells us that dispatch_event is expecting a &event, a reference to an event. Let's add an ampersand before event to send a reference. Rust's compiler may complain about unhandled results from the event dispatch. We can add another match statement to handle those. match dom_element.dispatch_event(&event) { Ok(_) => { leptos::log!("Custom event sent") }, Err(_) => { leptos::log!("Failed to send") } } We can now listen to our custom event from our Leptos component: #[component] fn RadApp(cx: Scope) -> Element { let log_response = |_| { leptos::log!("Our custom event happened") }; view! { cx, <MyComponent on:myCustomEvent=log_response/> } } Note that event names are camelCased We're still not totally there yet though. We need to actually tell this new custom event to bubble. //We need to create a config that is mutable (so we add 'mut' after let)
let mut event_config = web_sys::CustomEventInit::new(); // We set the bubble property to true
event_config.bubbles(true); // We create a new event with the special config using a different constructor method let event = web_sys::CustomEvent::new_with_event_init_dict( "myCustomEvent", &event_config
); // was previous
// let event = web_sys::CustomEvent::new("myCustomEvent"); And just like that we have custom events on components with references! The Complete Code use leptos::*; fn main() { mount_to_body(|cx| { view! { cx, <RadApp /> } }) } #[component] fn RadApp(cx: Scope) -> Element { let log_response = |_| { leptos::log!("Our custom event happened") }; view! { cx, <MyComponent on:myCustomEvent=log_response /> } } #[component] fn MyComponent(cx: Scope) -> Element { let dom_node_ref = NodeRef::new(cx); let trigger_sending_of_custom_event = move |_| { let mut event_config = web_sys::CustomEventInit::new(); event_config.bubbles(true); let event = web_sys::CustomEvent::new_with_event_init_dict("myCustomEvent", &event_config); match event { Ok(event) => { match dom_node_ref.get() { None => {} Some(dom_element) => { match dom_element.dispatch_event(&event) { Ok(_) => { leptos::log!("Custom event sent") }, Err(_) => { leptos::log!("Failed to send") } } } } } Err(_) => {} } }; view! { cx, <div _ref=dom_node_ref> <button on:click=trigger_sending_of_custom_event> "Trigger custom event" </button> </div> } }

